$(document).ready(function () {
  'use strict';

  $('.accordions').map(function(index, component) {
    $(component).children().map(function(index, child) {
      var summaryNode = $($(child).find(".summary"));
      var summaryContent = summaryNode.html();
      summaryNode.html("");
      summaryNode.append('<div class="content"></div>');
      $(child).find('.summary .content').html(summaryContent);
    });
  });

  $('input[type=checkbox]').on('change', function () {
    if ($(this).is(':checked')) {
      $($(this).closest('.item')).find('.summary').height($($(this).closest('.item')).find('.summary .content').innerHeight());
    } else {
      $($(this).closest('.item')).find('.summary').height(0);
    }
  });
});
$(document).ready(function () {
  'use strict';

  function displayMobile() {
$.each($('.alternated-highlights'), function (index, component) {
			$.each($(component).find('.item'), function(index, item) {
				var image = $(item).find('.image-container');
				image.remove();
				$(item).find('.head-text').after(image);
			});
		});
	}
	function displayDesktop() {
		$.each($('.alternated-highlights'), function (index, component) {
			$.each($(component).find('.item'), function (index, item) {
				var image = $(item).find('.image-container');
				image.remove();
				var textWrapper = $(item).find('.text-wrapper');
				if($(item).hasClass('alternate')) {
					$(textWrapper).after(image);
				} else {
					$(textWrapper).before(image);
				}
			});
		});
	}

	function resize() {
		if($(window).width() <= 320) {
			displayMobile(); 
		} else {
			displayDesktop();
		}
	}

	resize();
	$(window).resize(function(){
		resize();
	});

});
$( document ).ready(function() {

  $('.fixed-menu').prepend('<span class="navbar-switcher menu-burger"></span>');

  $('.fixed-menu').find('.navbar-switcher').on('click', function() {
    $(this).parent().find('nav').toggleClass('active');
  });

  var docElem = $(document)[0],
  $header = $( '.fixed-menu' ),
  changeHeaderOn = 100;


  function scrollPage() {
    window.requestAnimationFrame(scrollPage)
    var sy = window.scrollY;
    if ( sy >= changeHeaderOn ) {
      $header.addClass('fixed-menu-shrink' );
    }
    else {
      $header.removeClass('fixed-menu-shrink' );
    }
  }
  window.requestAnimationFrame(scrollPage)
});

