$(document).ready(function () {
  'use strict';

  /* =============================NAVBAR COLLAPSE ANIMATION ========================= */
  $('.navbar-switcher').click(function () {
    var menu = $($(this).attr('href'));
    if (menu.hasClass('active')) {
      menu.removeClass('active');
    } else {
      menu.addClass('active');
    }
  });

  $(document).click(function () {
    $('.navbar-collapse').removeClass('active');
  });

  //to prevent the closure
  $('.navbar-collapse').click(function (event) {
    event.stopPropagation();
  });
  $('.navbar-switcher').click(function (event) {
    event.stopPropagation();
  });
});
$(document).ready(function () {
  'use strict';

  $.each($('.slider'), function (index, slider) {
    var slides = $(slider).find(".slide");
    $.each(slides, function (index, slide) {
      if (slides.length === 1) {
        $(slide).find(".arrow-prev").remove();
        $(slide).find(".arrow-next").remove();
      }
      $(slide).css("background-image", "url(" +  $(this).attr('data-image') + ")");
      if (index === 0) {
        $(slide).addClass("active");
      }
    });
  });


  function previous(e) {
    e.preventDefault();
    var $slider = $(this).closest('.slider');
    var $current = $slider.find('.slide.active'),
    $prev = $current.prev('.slide');
    if (!$prev.length) {
      $prev = $slider.find('.slide:last');
    }
  $current.removeClass('active');
  $prev.addClass('active');
}

function next(e) {
  e.preventDefault();
  var $slider = $(this).closest('.slider');
  var $current = $slider.find('.slide.active'),
  $next = $current.next('.slide');
  if (!$next.length) {
   $next = $slider.find('.slide:first');
   }
   $current.removeClass('active');
   $next.addClass('active');
  }

  $('.slider .arrow-prev').on('click', previous);
  $('.slider .arrow-next').on('click', next);

  $( ".slider .slide" ).on( "swipeleft", previous );
});

$(document).ready(function () {
  'use strict';

  $('.play').on('click', function () {
    if($($(this).closest('.video-banner')).hasClass('active')) {
        $($(this).closest('.video-banner')).removeClass('active');
        $($(this).closest('.video-banner')).find('.video video').removeAttr('controls');
        $($(this).closest('.video-banner')).find('.video video').prop('muted', true);
    } else {
        $($(this).closest('.video-banner')).addClass('active');
        $($(this).closest('.video-banner')).find('.video video').get(0).pause();
        $($(this).closest('.video-banner')).find('.video video').get(0).currentTime = 0;
        $($(this).closest('.video-banner')).find('.video video').get(0).play();
        $($(this).closest('.video-banner')).find('.video video').attr('controls', true);
        $($(this).closest('.video-banner')).find('.video video').prop('muted', false);
    }
  });
});